import React, { Fragment } from "react";
import img from "../images/pagenotfound.svg";

const PageNotFound = () => {
  return (
    <Fragment>
      <img src={img} alt="Pge Not Found" className="text-center w-full h-2/3 md:w-96 m-auto" />
      <p className="mt-4 text-center">
        The page you are requesting is Not found, go back{" "}
        <span className="px-1 text-xl text-purple-800">Home</span>
      </p>
    </Fragment>
  );
};

export default PageNotFound;
